import React, { useState } from "react";

const F2 = ()  =>{
const [name,setName] = useState({
    fname : "",
    lname : "",
    email: ""
})

const Enter = (event) =>{

const val = (event.target.name);
console.log(val);
setName({
    val : event.target.value,
})

}
 const submit = (event) =>{
event.preventDefault();

}


return(
<>
<h2>
    These the Form In React .
</h2>
<form onSubmit={submit}>
    <input type = "text" placeholder="Enter Name " name = "fname" value={name.fname} onChange={Enter}/>
    <br/>
    <br></br>
    <input type = "text" placeholder="Enter password"  name = "lname" value={name.lname} onChange={Enter}/>
    <br></br>
    <br></br>
    <input type = "text" placeholder="Enter password"  name = "email" value={name.email} onChange={Enter}/>
    <br></br>
    <br></br>
    <button > Submit</button>
    
    
</form>

</>
)

    
}


export default F2;
